    body:
      string: "{\n  \"$schema\": \"https://schema.management.azure.com/schemas/2015-01-01/deploymentTemplate.json#\",\n
        \ \"contentVersion\": \"1.0.0.0\",\n  \"parameters\": {\n    \"vmList\": {\n
        \     \"type\": \"string\",\n      \"minLength\": 1,\n      \"metadata\":
        {\n        \"description\": \"List of virtual machines to be domain joined,
        if using multiple VMs, make their names comma separate. E.g. VM01, VM02, VM03.\"\n
        \     }\n    },\n    \"location\": {\n      \"type\": \"string\",\n      \"metadata\":
        {\n        \"description\": \"Location name of the virtual machine\"\n      },\n
        \     \"defaultValue\": \"[resourceGroup().location]\"\n    },\n    \"domainJoinUserName\":
        {\n      \"type\": \"string\",\n      \"metadata\": {\n        \"description\":
        \"Domain NetBiosName plus User name of a domain user with sufficient rights
        to perfom domain join operation. E.g. domain\\\\username\"\n      }\n    },\n
        \   \"domainJoinUserPassword\": {\n      \"type\": \"securestring\",\n      \"metadata\":
        {\n        \"description\": \"Domain user password\"\n      }\n    },\n    \"domainFQDN\":
        {\n      \"type\": \"string\",\n      \"metadata\": {\n        \"description\":
        \"Domain FQDN where the virtual machine will be joined\"\n      }\n    },\n
        \   \"ouPath\": {\n      \"type\": \"string\",\n      \"defaultValue\": \"\",\n
        \     \"metadata\": {\n        \"description\": \"Specifies an organizational
        unit (OU) for the domain account. Enter the full distinguished name of the
        OU in quotation marks. Example: \\\"OU=testOU; DC=domain; DC=Domain; DC=com\\\"\"\n
        \     }\n    }\n  },\n  \"variables\": {\n    \"domainJoinOptions\": 3,\n
        \   \"vmListArray\": \"[split(parameters('vmList'),',')]\"\n  },\n  \"resources\":
        [\n    {\n      \"comments\": \"Join domain - JsonADDomainExtension\",\n      \"apiVersion\":
        \"2015-06-15\",\n      \"type\": \"Microsoft.Compute/virtualMachines/extensions\",\n
        \     \"name\": \"[concat(trim(variables('vmListArray')[copyIndex()]),'/joindomain')]\",\n
        \     \"location\": \"[parameters('location')]\",\n      \"copy\": {\n        \"name\":
        \"vmDomainJoinCopy\",\n        \"count\": \"[length(variables('vmListArray'))]\"\n
        \     },\n      \"properties\": {\n        \"publisher\": \"Microsoft.Compute\",\n
        \       \"type\": \"JsonADDomainExtension\",\n        \"typeHandlerVersion\":
        \"1.3\",\n        \"autoUpgradeMinorVersion\": true,\n        \"settings\":
        {\n          \"Name\": \"[parameters('domainFQDN')]\",\n          \"User\":
        \"[parameters('domainJoinUserName')]\",\n          \"Restart\": \"true\",\n
        \         \"Options\": \"[variables('domainJoinOptions')]\",\n          \"OUPath\":
        \"[parameters('ouPath')]\"\n        },\n        \"protectedSettings\": {\n
        \         \"Password\": \"[parameters('domainJoinUserPassword')]\"\n        }\n
        \     }\n    }\n  ]\n}\n"
